import React, { useState } from 'react'
import { Link } from 'react-router-dom';

const Login = () => {

  const [formData,setFormData]= useState({
    email:'',
    password:''
  });

  const handleChange=(e)=>{
    setFormData({...formData, [e.target.name]:e.target.value})
  }
  const handleSubmit=(e)=>{
    e.preventDefault();
    // axios.post("http://lcalhost:4000/login",formData)
    console.log("hello world")
  }

  return (
    <div className='flex  flex-col' >
      <form onSubmit={handleSubmit} className=' flex flex-col'>
        <input  type='email' name='email' onChange={handleChange} className='h-8 border'/>
        <input type='password' name='password' onChange={handleChange} className='h-8 border'/>
        <button type='submit' onChange={handleChange} className='bg-green-500 border'>submit</button>
      </form>

      <div >
        <p>if you haven,t an account? </p>
        <Link to={'/signup'}>signup</Link>
      </div>
    </div>
  )
}

export default Login;
